// mindmaptoolbar.jsx
import React, { useState, useEffect } from 'react';
import { Plus, Edit, Trash2, Save, FilePlus, LogOut, LayoutGrid, RefreshCw } from 'lucide-react'; // Changed icons
import { useNavigate } from 'react-router-dom'; // Import useNavigate
import './mindmaptoolbar.css'; // Create this CSS file

const MindMapToolbar = ({
  onAddNode,
  onEditNode,
  onDeleteNode,
  selectedNode,
  isRootSelected,
  onSave,
  onNewMap, // Still needed for creating a new blank map while in editor
  currentMindMapId,
  loading,
  message,
  onLogout,
  userName,
  currentMapTitle,
  onSetMapTitle
}) => {
  const isNodeSelected = selectedNode !== null;
  const [isEditingTitle, setIsEditingTitle] = useState(false);
  const [editableTitle, setEditableTitle] = useState(currentMapTitle);
  const navigate = useNavigate(); // Initialize useNavigate

  const handleTitleChange = (e) => {
    setEditableTitle(e.target.value);
  };

  const handleTitleBlur = () => {
    onSetMapTitle(editableTitle);
    setIsEditingTitle(false);
  };

  const handleTitleKeyDown = (e) => {
    if (e.key === 'Enter') {
      handleTitleBlur();
    } else if (e.key === 'Escape') {
      setEditableTitle(currentMapTitle); // Reset to original
      setIsEditingTitle(false);
    }
  };

  // Update editable title when currentMapTitle prop changes from parent
  useEffect(() => {
    setEditableTitle(currentMapTitle);
  }, [currentMapTitle]);

  const handleGoToGallery = () => {
    navigate('/gallery');
  };

  return (
    <div className="mindmap-toolbar-wrapper">
      <div className="mindmap-toolbar">
        <div className="toolbar-section map-actions">
          <button onClick={handleGoToGallery} className="btn btn-secondary" title="Back to My Maps">
            <LayoutGrid className="btn-icon" /> Maps
          </button>
          <button onClick={onNewMap} className="btn btn-success" title="Create New Blank Map">
            <FilePlus className="btn-icon" /> New
          </button>
          <button onClick={onSave} className="btn btn-primary" disabled={loading} title="Save Current Mind Map">
            {loading ? <RefreshCw className="btn-icon spin" /> : <Save className="btn-icon" />} Save
          </button>
        </div>

        <div className="toolbar-section node-actions">
          <button
            onClick={onAddNode}
            className="btn btn-primary"
            disabled={!isNodeSelected && !isRootSelected}
            title="Add Child Node"
          >
            <Plus className="btn-icon" /> Add
          </button>
          <button
            onClick={onEditNode}
            className="btn btn-secondary"
            disabled={!isNodeSelected}
            title="Edit Selected Node"
          >
            <Edit className="btn-icon" /> Edit
          </button>
          <button
            onClick={onDeleteNode}
            className="btn btn-danger"
            disabled={!isNodeSelected || isRootSelected}
            title="Delete Selected Node"
          >
            <Trash2 className="btn-icon" /> Delete
          </button>
        </div>

        <div className="toolbar-section current-map-info">
          {isEditingTitle ? (
            <input
              type="text"
              value={editableTitle}
              onChange={handleTitleChange}
              onBlur={handleTitleBlur}
              onKeyDown={handleTitleKeyDown}
              className="map-title-input"
              autoFocus
            />
          ) : (
            <span className="map-title-display" onClick={() => setIsEditingTitle(true)} title="Click to edit map title">
              {currentMapTitle || "Untitled Map"}
            </span>
          )}
        </div>

        <div className="toolbar-section user-info">
          {userName && <span className="user-name" title="Logged in as">{userName}</span>}
          <button onClick={onLogout} className="btn btn-warning" title="Logout">
            <LogOut className="btn-icon" /> Logout
          </button>
        </div>
      </div>
      {message && <div className={`toolbar-message ${loading ? 'loading' : ''}`}>{message}</div>}
    </div>
  );
};

export default MindMapToolbar;
